   "source": [
    "### ASK\n",
    "1. How do annual members and casual riders use Cyclistic bikes differently?\n",
    "* How many km, and hours were ridden last year (season, month, day of week) in each segment(member, casual) \n",
    "* The popularity of each bike type in our segments. \n",
    "* The popularity of stations as Start/End points for each segment.\n",
    "* The highest increase and decrease between the station's users.\n",
    "--------------------\n",
    "\n",
    "2. Why would Casual riders buy Cyclistic annual memberships?\n",
    "3. How can Cyclistic use digital media to influence casual riders to become members?\n",
    " \n",
    " \"These Questions would be answered in the last section\""
   ]
  },
