   "source": [
    "# Changing Date/Time ==> useful columns to let us compare them better \n",
    "df_clean['startAt'] <- as.Date(df_clean$startedAt)\n",
    "df_clean['startYear'] <- format(as.Date(df_clean$startedAt), \"%Y\")\n",
    "df_clean['startMonth'] <- format(as.Date(df_clean$startedAt), \"%m\")\n",
    "df_clean['startDay'] <- format(as.Date(df_clean$startedAt), \"%a\")\n",
    "df_clean['endAt'] <- as.Date(df_clean$endedAt)\n",
    "df_clean['startTime'] <- format(as.POSIXct(df_clean$startedAt), format = \"%H:%M\")\n",
    "df_clean['startHour'] <- as.numeric(format(as.POSIXct(df_clean$startedAt), format = \"%H\"))\n",
    "df_clean[\"StartWeekendOrWeekday\"] <- ifelse(df_clean$startDay == \"Sat\" | df_clean$startDay == \"Sun\", 'weekend', 'weekday')\n",
    "df_clean[\"endTime\"] <- format(as.POSIXct(df_clean$endedAt), format = \"%H:%M\")\n",
    "\n",
    "\n",
    "head(df_clean)"
   ]
