    "# Calculating Duration And remove values less or equal with 0.0 \n",
    "\n",
    "df_clean['duration']<- as.double(difftime(df_clean$endedAt, df_clean$startedAt, units=\"mins\"))\n",
    "df_clean <- df_clean[- which(df_clean$duration < 1),]"
