   "source": [
    "# Calculate ride distance in Km \n",
    "library(geosphere)\n",
    "df_clean['distance'] <- (distGeo(matrix(c(df_clean$startLng, df_clean$startLat), ncol=2),matrix(c(df_clean$endLng, df_clean$endLat), ncol=2))/1000.0)\n",
    "\n",
    "df_clean[\"oneway_round\"] <- case_when(df_clean$distance == 0.0 ~ \"round\",df_clean$distance > 0.0 ~ \"one_way\")\n",
    "\n",
    "df_clean[\"byHours_daily\"] <- case_when(df_clean$duration < 1440 ~ \"byHours\", df_clean$duration >= 1440 ~ \"daily\")\n"
   ]
  },
