    "#suggested operations\n",
    "df_cl <- df_clean\n",
    "\n",
    "head(df_clean)\n",
    "#remove unusual records\n",
    "\n",
    "df_cl<-df_cl[-which((df_cl$oneway_round== \"one_way\" & (df_cl$distance/df_cl$duration)>1 )),]\n",
    "\n",
    "\n",
    "\n",
    "cat(\"mean of ride duration == \", mean(df_cl$duration),\"\\n\")\n",
    "\n",
    "cat(\"max of ride duration == \", max(df_cl$duration),\"\\n\")\n",
    "\n",
    "getmode <- function(v) {\n",
    "   uniqv <- unique(v)\n",
    "   uniqv[which.max(tabulate(match(v, uniqv)))]\n",
    "}\n",
    "\n",
    "cat(\"mode of ride duration == \", getmode(df_cl$duration))"
   ]
