    "# Adding Seasons to dataset\n",
    "\n",
    "\n",
    "df_cl[\"startMonth\"] <-as.numeric(df_cl$startMonth)\n",
    "\n",
    "df_cl <- df_cl %>%\n",
    "mutate(\n",
    "season=case_when(\n",
    "startMonth %in% 10:12 ~\"fall\",\n",
    "startMonth %in%  4:6 ~\"Spring\",\n",
    "startMonth %in%  1:3 ~\"Winter\",\n",
    "    TRUE ~ \"Summer\"))\n",
    "\n",
    "df_cl['s_m_name']<-month.name[df_cl$startMonth]"
   ]
