   "source": [
    "### Description:\n",
    "* Docked_bike ==> just were used by Casual users, also as the last one in popularity with almost 300,000 trips.\n",
    "* Electric_bike ==> have almost similar usage between annual and casual users with about 600,000 and 500,000 trips respectively.\n",
    "* Classic_bike ==> The most popular rideable type with a significant difference with about  2 times for Casual users and 3 times for members more than electric_bike. Moreover, the annual member's usage of classic_bike is remarkably higher than Casual users.\n",
    "\n",
    "\n",
    "\n",
    "\n",
    "\n",
    "### Conclusion\n",
    "* We could prepare a special offer for docked_bike users to join our annual members because we know most of the time docked users are casual without an annual membership. \n",
    "\n",
    "    * For example: we could set an offer that involves a discount on annual membership for just docked and electrical bikes with different percentages, to balance usage pressure and also finance the maintenance costs and ROI for these bikes, which is profitable and cover the discount percentage.\n"
   ]
