   "source": [
    "# plot 2\n",
    "ggplot(\n",
    "    df_cl%>%\n",
    "    group_by(memberCasual, oneway_round) %>%\n",
    "    summarise(n = n(), duration=mean(duration),distance=mean(distance) )%>%\n",
    "    mutate(percentage = n/sum(n) *100) ,\n",
    "    aes(x=memberCasual, y=n, fill=oneway_round)) +\n",
    "geom_col(position=\"dodge\") + \n",
    "geom_text(aes(label = paste0(round(percentage), \"%\")), position=position_dodge(0.85), vjust = 0) +\n",
    "labs(x=\"Users\", y=\"Bike Trips *1000\", title=\"One way or round trip preference per user\")"
   ]
