    "### Description:\n",
    "* The most of users take one_way ride\n",
    "* The 8% of Casual users and just 2% of annual members take round ride.\n",
    "\n",
    "### Conclusion \n",
    "* The bike ride is a part of the user's way to the final destination. and they use another way to come back to the started point or continue their way.\n",
    "\n",
    "    * Cooperation with other transportation companies, and preparing some multi-discount-schedule membership, for instance, using a discount for the bus with purchasing an annual membership from Cyclists.\n",
