   "source": [
    "#Plot 3\n",
    "ggplot(\n",
    "    df_cl[which((df_cl$byHours_daily == \"daily\")),]%>%\n",
    "    group_by(memberCasual,byHours_daily, s_m_name,StartWeekendOrWeekday) %>%\n",
    "    summarise(n = n(), duration=mean(duration),distance=mean(distance) )%>%\n",
    "    group_by(memberCasual)%>%\n",
    "    mutate(percentage = n/sum(n) *100),\n",
    "    aes(x=s_m_name,y=n ,fill=StartWeekendOrWeekday))+\n",
    "geom_col(position=\"dodge\")+\n",
    "facet_wrap(~memberCasual)+\n",
    "geom_text(aes(label = paste0(round(n))), position=position_dodge(0.85), vjust = 0)+\n",
    "labs(x=\"Months\", y=\"Bike trips \", title=\"The Bike rent for more than 1 day in months \")+\n",
    "theme(axis.text.x=element_text(angle=90,hjust=1 ))+\n",
    "scale_x_discrete(limits=c(\"January\",\"February\",\"March\",\"April\",\"May\",\"June\",\"July\",\"August\",\"September\",\"October\",\"November\",\"December\"))"
   ]
