    "### Description \n",
    "* Users had about 1200 \" daily trips\" and most of them were Casual users \n",
    "* These kinds of trips were balanced on weekdays and weekends except in April.\n",
    "### Conclusion \n",
    "* It's a quite valuable opportunity to offer some plans to Casual members who need to bike for more than some hours to join our annual membership.\n",
    "-----------"
