   "source": [
    "# Plot 4\n",
    "ggplot(\n",
    "    df_cl%>% \n",
    "    group_by(memberCasual, startHour)%>%\n",
    "    summarise(n = n()/1000, duration=mean(duration),distance=mean(distance) )%>%\n",
    "    mutate(percentage = n/sum(n) *100) ,\n",
    "    aes(x=startHour, y= n , color=duration))+\n",
    "geom_point()+\n",
    "geom_line()+\n",
    "geom_smooth(method=\"lm\",formula ='y ~ x')+\n",
    "geom_text(aes(label = paste0(round(percentage),\"%\")), vjust = 1.75)+\n",
    "labs(x=\"Start Hour\", y=\"Bike trips *1000 \", title=\"Bike trips & mean duration per day long\")+\n",
    "facet_wrap(~memberCasual)"
   ]
