    "### Description:\n",
    "* The Casual & annual members usage start increasing from \" 4 O'clock\" to \" 17 O'clock \"and then decreased, also casuals had 9 houre upper than smoother line, while annual members had almost 13 hours upper that. \n",
    "* Annual members had almost unchange mean of duration in all the day, while the Casuals had highest mean of duration at \" 1 \" to \"  5 \" also the lowest mean of duration at \" 5 \" to \"8\"\n",
    "\n",
    "\n",
    "### Conclusion\n",
    "* 70% Casual members bike trips were  at 10 to 19 and upper smooth line\n",
    "* 85% annual members bike trips were at 6 to 19 and upper smooth line \n",
    "* 13% of annual members take ride between 20 to 4 (night & midnight & earlymorning), while, 22% casual members had trips between 0 to 5 o'clock.\n",
    "    * it would be a milestone to balance the day long profit also turn casuals to annual with attrative offers (2% of annual members use bikes in midnight, while 6% of casual member use midnight ride)\n",
    "* Casual members who take ride from 5 to 10 had farther route, so their mean duration was significantly more than other.\n",
    "    * This kind of users would be target of marketing team.\n",
    "    \n",
    "--------------------"
   ]
