   "source": [
    "# Plot 5\n",
    "ggplot(\n",
    "   df_cl%>%\n",
    "    group_by(memberCasual, startDay) %>%\n",
    "    summarise(n = n(), duration=mean(duration),distance=mean(distance) )%>%\n",
    "    mutate(percentage = n/sum(n) *100)\n",
    " , aes(x=startDay, y=n/1000, color=distance,size=2, shape= memberCasual)) + \n",
    "geom_point()+\n",
    "geom_text(aes(label = paste0(round(duration))), vjust = 1.75)+\n",
    "scale_x_discrete(limits=c(\"Mon\", \"Tue\", \"Wed\", \"Thu\", \"Fri\", \"Sat\", \"Sun\"))+ \n",
    "labs(x=\"Day of Week\", y=\"Bike Trips *1000 \", title=\"Bike trips and mean duration per day of week\")"
   ]
  },
