   "source": [
    "### Description:\n",
    "* The annual members' mean of duration was significantly & almost 3 times lower than Casuals.\n",
    "* The annual member had an almost unchanged trend for \"Mon\" to \"Thu\", while they had a smooth increasing trend from \"Thu\" to \"Sun\".\n",
    "* The Casual member had a decrease in \"Mon\" to \"Tue\" & almost unchanged figures for \"Tue\" to \"Thu\", while they had a sharp increasing trend from \"Thu\" to \"Sun\".  \n",
    "* The number of annual member rides stood stable during the week. While the Casual members were Aligned with the mean duration trend and picked on  Sunday.\n",
    "### Conclusion\n",
    "* Same number of annual members have more mean duration in weekend\n",
    "* Number of Casual users & mean of distance have Correlation with mean of duration, moreover, many of Casual members use the bike rides just in weekend.\n",
    "    * weekend should be target of marketing teams to change casual to annual \n",
    "* The annual member's trips had increase on weekday and decrease on weekend , by contrast, casual's trips decreased on weekday and increased on weekend\n",
    "----------------------"
   ]
