   "source": [
    "# Plot 6\n",
    "ggplot(df_cl%>%\n",
    "    group_by(memberCasual, s_m_name,season) %>%\n",
    "    summarise(n = n(), duration=mean(duration),distance=mean(distance) )%>%\n",
    "    group_by(memberCasual)%>%\n",
    "    mutate(percentage = n/sum(n) *100)\n",
    "       , aes(x=s_m_name , y= n/1000 , shape = season , color = duration,size=distance))+\n",
    "geom_point()+\n",
    "facet_wrap(~memberCasual)+\n",
    "labs(x=\"Start Month\", y=\"Bike trips*1000\", title=\"Bike trips and mean of duration per month & season \")+\n",
    "geom_text(aes(label = paste0(round(duration))), vjust = 1.75)+\n",
    "theme(axis.text.x=element_text(angle=90,hjust=1))+\n",
    "scale_x_discrete(limits=c(\"January\",\"February\",\"March\",\"April\",\"May\",\"June\",\"July\",\"August\",\"September\",\"October\",\"November\",\"December\"))"
   ]
  },
