   "source": [
    "### Description\n",
    "* The Casual users had higher figures in monthly mean duration with between 1.5 - 4 times more than annual members.\n",
    "* Both segments, had risen in from winter to spring and picked there, followed by that, they dipped down to fall and situated the lowest figures in December.\n",
    "* Casual users' mean duration & usage had more and sharper fluctuation in seasons, but the annual members had smooth oscillation in the year trend.\n",
    "* The number of bike trips in annual and casual members have same trend in year, increase first half and decrease on other times.\n",
    "* casual users picked in June with more than 350,000 bike trips, while annual members reached on July at almost 325,000 bike trips.\n",
    "* Casual users had more and sharper fluctuation on Summer and Fall, they have significant decrease between AUG and DEC\n",
    "* Both segments, had highest mean of duration in  Spring and highest usage in Summer\n",
    "### Conclusion:\n",
    "* The casual and annual users had a trend between Spring to Summer which is increasing number of rides and decreasing mean of duration also the Casuals had sharper gradient. It means the casual and annual members use bikes in Summer for shortest trips.\n",
    "---------------------------------\n"
   ]
