   "source": [
    "# # Plot 7\n",
    "ggplot(df_cl %>% \n",
    "  group_by(memberCasual, StartWeekendOrWeekday,startStationName) %>% \n",
    "  summarise(total=n(),duration=mean(duration), distance=mean(distance)) %>% \n",
    "  arrange(desc(total))%>%\n",
    "  slice_head(n=10))+\n",
    "geom_point(aes(x=startStationName, y =  total, shape=StartWeekendOrWeekday , color=StartWeekendOrWeekday,size=duration))+\n",
    "facet_wrap(~memberCasual)+\n",
    "labs(x=\"Start Station\", y=\"Bike trips \", title=\"10 popular start station in weekday & weekend \")+\n",
    "theme(axis.text.x=element_text(angle=90,hjust=1 ))"
   ]
