   "source": [
    "### Description \n",
    "* The Casual users had significantly more activities in these stations.\n",
    "* The Casual user's usage on weekdays and weekends are almost equal, while the annual members had a remarkable difference from each other.\n",
    "* We have the 10 most popular stations at the start/end of the way.\n",
    "### Conclusion\n",
    "* These stations are quite a worthy place for the company's advertisement. Particularly which had not any annual members.\n",
    "* We saw a very significant decrease for annual members on weekends in these stations which let the company make some marketing plans to handle that.\n",
    "---------------"
