   "source": [
    "### Description\n",
    "* The figures of stations which were popular as start-Station for Annual memmbers was higher, while the number of stations which were popular as end-stations for Casual members was higher.\n",
    "* We saw two station top of the map as Casual users popular station.\n",
    "### Conclusion\n",
    "* The Costline area was the most popular place for ending trips for Casual members, so the most of Casual users had distanation to coastline.\n",
    "* End Stations were centralized particular area.\n",
    "* The popular start stations had significantly more users in comparison with end stations and it means starting point were more centralized and also users take trips to broadcast all over the city.\n",
    "---------------------"
   ]
  },
