   "source": [
    "### Final Conclusion(suming up)\n",
    "\n",
    "#### Now we could answer these questions:\n",
    "\n",
    "2. Why would Casual riders buy Cyclistic annual memberships? \n",
    "\n",
    "* we know  casual user's patterns and trends in:\n",
    "    - usage of bike type\n",
    "    - usage of ride type\n",
    "    - ride duration\n",
    "    - ride distance \n",
    "    - usage on the day of the week\n",
    "    - usage on the month/season\n",
    "    - and also the most popular stations for starting and ending rides \n",
    "\n",
    "* ultimately the marketing team could create some specific plans to target casual users such as discounts, and advertising based on place, time, date(month, season), bike type, and destination.\n",
    "\n",
    "3. How can Cyclistic use digital media to influence casual riders to become members?\n",
    "\n",
    "* The digital media team could find data that make more patterns such as how many users share pictures with the company's bike or how many groups are available to make plans for rides with each other and then, target these users for offering annual memberships.\n",
    "\n",
    "* Also, they could launch campaigns to encourage people in high-demand seasons to attract Casual users for being annual memberships."
   ]
